import { CHANGE_RED, DECREASE_TYPE, INCREASE_TYPE, CHANGE_YELLOW } from "../actionType";

export const increaseCount = ()=>{
    return {
        type: INCREASE_TYPE,
    }
}

export const decreaseCount = ()=>{
    return {
        type: DECREASE_TYPE,
    }
}

export const changeRed = ()=>{
    return {
        type: CHANGE_RED,
    }
}

export const changeYellow = ()=>{
    return {
        type: CHANGE_YELLOW,
    }
}
